  false,\n\t\"url\": null,\n\t\"notes\": \"The Billfish Angler Survey provides estimates
  of billfish angling activities in the Pacific and Indian Oceans. This collection
  of recreational billfish catch and effort has occurred annually since 1969 and provides
  an index of fishing success in many Pacific billfish destinations. Catch per unit
  of effort (CPUE) is measured in catch of billfish per angler fishing day. This measure
  of angler success, tracked over time, can indicate changes in stock size caused
  by over fishing, changing environmental conditions, or local economic and political
  events. Only a small proportion of the data are from anglers in the Indian Ocean.\",\n\t\"license_title\":
